function Index() {
  return (
    <section class="hero has-text-light has-background-prime">
      <div class="hero-body">
        <div class="container">
          <h1 class="title">Home</h1>
          <h2 class="subtitle">Server side rendering</h2>
        </div>
      </div>
    </section>
  );
}

export default Index;
